import React from 'react';
import Drawer from './components/drawer'
import { BrowserRouter as Router, Switch, Route} from "react-router-dom"


function App() {
  return (
<Router>
  <Switch>
    <Route path='/manual/manager/:id?' >
      <Drawer/>
    </Route> 
  </Switch> 
</Router>  
  );
}

export default App;
